import * as C from './app.styles';
import { Item } from './types/Item'

const app = () => {
  const[list, setList] = useState<Item[]>([
    { id: 1, name: 'comprar pão na padaria', done: false},
    { id: 2, name: 'comprar bolo na padaria', done: false},
  ]);

  return(
    <C.Container>
      <C.Area>
        <C.Header>
          Lista de Tarefas
        </C.Header>
      </C.Area>
    </C.Container>
  );
}


export default app;
